typedef.haxe_doc:
A range in a text document expressed as (zero-based) start and end positions.

	If you want to specify a range that contains a line including the line ending
	character(s) then use an end position denoting the start of the next line.
	For example:
	```ts
	{
	start: { line: 5, character: 23 }
	end : { line 6, character : 0 }
	}
	```

create.haxe_doc:
Creates a new text document.

		@param uri The document's uri.
		@param languageId  The document's language Id.
		@param version The document's initial version number.
		@param content The document's content.

update.haxe_doc:
Updates a TextDocument by modifying its content.

		@param document the document to update. Only documents created by TextDocument.create are valid inputs.
		@param changes the changes to apply to the document.
		@param version the changes version for the document.
		@returns The updated TextDocument. Note: That's the same document instance passed in as first parameter.

version.haxe_doc:
The version number of this document (it will increase after each
		change, including undo/redo).

		@readonly

getText.haxe_doc:
Get the text of this document. A substring can be retrieved by providing a range.
@param range (optional) An range within the document to return. If no range is passed, the full content is returned. Invalid range positions are adjusted as described in [Position.line](#Position.line) and [Position.character](#Position.character). If the start range position is greater than the end range position, then the effect of getText is as if the two positions were swapped.
@return The text of this document or a substring of the text if a range is provided.

positionAt.haxe_doc:
Converts a zero-based offset to a position.

		@param offset A zero-based offset.
		@return A valid [position](#Position).

offsetAt.haxe_doc:
Converts the position to a zero-based offset.
		Invalid positions are adjusted as described in [Position.line](#Position.line)
		and [Position.character](#Position.character).

		@param position A position.
		@return A valid zero-based offset.
